import React from "react";
import './MyName.css'

const firstName = document.getElementById("firstName")
const lastName = document.getElementById("lastName")
const welcomeName = {firstName, lastName}



function MyName() {
    return (
        <div className="MyName">
            <p className="MyName-test">Welcome! </p>
            <h1 className="MyName-test">Personal Info</h1>
            <p className="MyName-title">FirstName:</p>
            <input type="text" className="MyName-input" id="firstName"/>
            <p className="MyName-title">Last Name:</p>
            <input type="text" className="MyName-input" id="lastName"/><br/>
            <input type="submit" className="MyName-input" name="123" value="submit"/>
        </div>
    );
}

export default MyName
